import React, { useEffect, useState } from "react";
import { Card, Input, Button, Form, Divider, Tooltip, Row, Col} from 'antd';
import { QuestionCircleOutlined } from "@ant-design/icons";
import { Tabs } from 'antd';
import ConfirmationModal from "components/Modal/ConfirmationModal";
import ENUMS from "constants/appEnums";

const { TabPane } = Tabs;

export default function DefaultValues() {

    const [modalData, setModalData] = useState(null);
    const [showConfirmationModal, setShowConfirmationModal] = useState(false);

    const [defaultValues, setDefaultValues] = useState([]);
    const [projectId, setProjectId] = useState();
    const [wellId, setWellId] = useState();

    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const handleChangeConfirmed = (data) => {
        console.log(data)
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const onFinish = (values) => {
        setModalData(values);
        setShowConfirmationModal(true);
    };

    const callback = (key) => {
        console.log(key);
    }

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    const fetchDailyLog = (well_id) => {
        axios.get(config.API_URL + ENUMS.API_ROUTES.DAILY_LOG + '/' + well_id,
            {
                ...HttpUtil.adminHttpHeaders(),
            })
            .then(res => {
                if (res.status === 200 && res.data) {
                    let logs = [];
                    if (res.data.logs) {
                        logs = res.data.logs.map((log, index) => {
                            return {
                                key: index,
                                date: moment(log.date).format("YYYY-MM-DD"),
                                time: moment(log.date).format("HH : mm"),
                                description: log.description,
                            }
                        })
                    }
                    setDailyLogs(logs);
                }
            })
            .catch(e => {
                console.log(e)
            })
    }

    const setParams = (locationData) => {
        if (locationData.state && locationData.state.projectId) {
            setProjectId(locationData.state.projectId);
            setWellId(locationData.state.wellId);
            fetchDefaultValues(locationData.state.wellId);
        }
        else if (locationData.search) {
            const params = new URLSearchParams(locationData.search);
            const projectIdSearch = params.get('projectId');
            const wellIdSearch = params.get('wellId');
            setProjectId(projectIdSearch);
            setWellId(wellIdSearch);
            fetchDefaultValues(wellIdSearch);
        }
    }

    useEffect(() => {
        setParams(location);
    }, [])

    useEffect(() => {
        return history.listen((locationData) => { 
            if(location.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.DEFAULT_VALUES)) {
                setParams(locationData);
            }
        }) 
    }, [history])

    return (
        <>
            <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                <div className="max-w-580-px mx-auto">
                    <div>
                        On the template page fill any information that may be relevant across all stages,
                        such information is found in completion procedures etc. Common information that can be
                        normally filled out in the template is the following:
                    </div>
                </div>
            </Card>
            <Card bordered={false} style={{ width: '100%', marginBottom: '1.5rem' }}>
                <Form
                    labelAlign="left"
                    name="basic"
                    initialValues={{
                        remember: true,
                    }}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    className="default-values-form"
                >
                    <Tabs onChange={callback} type="card">
                        <TabPane tab="Parameter bounds" key="1">
                            <Divider orientation="left" plain><strong>Parameter bounds</strong></Divider>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C1 Min
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c1_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C1 Max
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c1_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Q1 Min
                                                <Tooltip title="Wellbore Quality/Energy, no unit">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="q1_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>    
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Q1 Max
                                                <Tooltip title="Wellbore Quality/Energy, no unit">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="q1_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                K min
                                                <Tooltip title="Permeability, Darcy mD">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="k_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                K max
                                                <Tooltip title="Permeability, Darcy mD">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="k_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save parameter bounds
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Model Params" key="2">
                            <Divider orientation="left" plain><strong>Model Params</strong></Divider>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Model
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="model"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Response
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="response"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Source
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="source"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Layer
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="layer"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save model params
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Fluid properties" key="3">
                            <Divider orientation="left" plain><strong>Fluid properties</strong></Divider>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Viscosity
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="viscosity"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Density
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="desnsity"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Compressibility
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="compressibility"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save fluid properties
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Filtering" key="4">
                            <Divider orientation="left" plain><strong>Filtering</strong></Divider>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                F Low (Hz)
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="f_low"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                F High (Hz)
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="f_high"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                New Sample Rate
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="new_sample_rate"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Data Sample Rate
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="data_sample_rate"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save filtering
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Inversion" key="5">
                            <Divider orientation="left" plain><strong>Inversion</strong></Divider>
                            <Row>

                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Algorithm
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="algorithm"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Grid density
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="grid_density"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Weighting
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="weighting"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                wlevexp
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="wlevexp"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Loop
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="loop"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Method
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="method"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Total Width
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="total_width"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Tolerance
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="tolerence"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Iterations
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="iterations"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>

                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save inversion
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Well name" key="6">
                        <Divider orientation="left" plain><strong>Well name</strong></Divider>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Company
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="company"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Well
                                                <Tooltip title="subdirectory with this name must exist">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="well"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save well name
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Special defaults" key="7">
                            <Divider orientation="left" plain><strong>Special defaults</strong>  (do not change unless the consequences are understood)</Divider>
