                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Pres
                                                <Tooltip title="This is reservoir pressure gradient at the surface, unit is psi/ft, Taken from the well openning pressure at stage 1 ">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="pres"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Young
                                                {/* <Tooltip title="?">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip> */}
                                            </span>
                                        }
                                        name="young"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Overburden
                                                {/* <Tooltip title="?">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip> */}
                                            </span>
                                        }
                                        name="overburden"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Poisson
                                                <Tooltip title="Usually between 0.2-0.3, can never be greater than 0.5">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="poisson"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Eta cp
                                                <Tooltip title="Usually between 10-25 for HVFR+SLW and HVFR+SLW+Gel, Between 20-30 for  Gel+XLink, Between 40-100 for Xlink">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="eta_cp"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Flui dT
                                                <Tooltip title="Use 1 for SLW, Use 1 SLW+GEL, Use 2 SLW+XL, Use 2 gel+Xlink, Use 3 for Xlink">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="fluid_t"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Tect
                                                <Tooltip title="?">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="tect"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Fluid density
                                                <Tooltip title="unit ppg, this is density of the wellbore fluid at the start of the job, 8.33 ppg for fresh water">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="fluid_density"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Divider orientation="left" plain><strong>Do not change</strong></Divider>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Diverter time
                                                <Tooltip title="If they apply Diverter what is the percentage of the injection time prior to applying the diverter (here 70%)">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="Diverter_time"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Met res
                                                <Tooltip title="Use 1 to use Ibrahim's method in calculating the reservoir pressure and 2 to use Dan's method">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="met_res"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                FFKw Correction
                                                <Tooltip title="?">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="ffkw_correction"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                K MPa
                                                <Tooltip title="?">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="k_mpa"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input type="number" />
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
